description:
This is the map pack needed to play on the modded server GUC CT SERVER, for call of duty 4 on the pc.

There are many added game settings which come with the mod please view the read me
file to see a few examples of the custom settings. This pack contains the mods fast file and 4 new maps.

Each of these maps have been played with many other custom maps and chosen by my regular players (thanks goes to evo, bobinator, Chrisuk, sparcix, Derek, egg, guc simon, chris17585, guc kckbxr, guc dinomario, and Nocturne).

